// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awPanelRenderFunction } from 'js/AwPanelService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwPanelService', () => import('js/AwPanelService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awPanelRenderFunction",
            "deps": "js/AwPanelService"
        },
        "revealAction": {
            "actionType": "JSFunction",
            "method": "panelRevealAction",
            "inputData": {
                "props": "{{props}}"
            },
            "deps": "js/AwPanelService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onMount": "revealAction"
    },
    "props": {
        "caption": {
            "type": "string"
        },
        "attributes": {
            "type": "object"
        },
        "on-submit": {
            "type": "action"
        },
        "submit-action": {
            "type": "action"
        },
        "reveal-action": {
            "type": "action"
        }
    },
    "_viewModelId": "AwPanel",
    "_uniqueViewModelId": "AwPanel",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awPanelRenderFunction, undefined, ctxImportObj );

export default Component;
